import Card from "./UI/Card";
import Button from "react-bootstrap/Button";

const DifficultySelector = (props) => {
  return (
      <>
    <Card>
      <Button variant='success' size="lg">
        Easy
      </Button>
    </Card>
        <Card>
        <Button variant='success' size="lg">
          Easy
        </Button>
      </Card>
          <Card>
          <Button variant='success' size="lg">
            Easy
          </Button>
        </Card>
        </>
  );
};

export default DifficultySelector;
